import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import './Form'


function App() {
  return ( 

  <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Accueil</Link>
            </li>
            <li>
              <Link to="/conf">Configuration</Link>
            </li>
            <li>
              <Link to="/about">À propos</Link>
            </li>
          </ul>
        </nav>


        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/conf">
            <Configuration />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}


function Home() {
  return (<div>
    <h2>Accueil</h2>
      <p>Hello</p>
          </div>);
}

function Configuration() {
  return (<div>
    <h2>Configuration</h2>
    <NameForm /> 
          </div>);
}

function About() {
  return (<div>
    <h2>À propos</h2>
    <h3>L'équipe est constituée de :</h3>
    <ul>
      <li>Maxence Lavenu</li>
      <li>Alyssia Prévoté</li>
      <li>Jonathan Debailleux</li>
      <li>Juan Fernando Herrada</li>
    </ul>
          </div>);
}


export default App;
